 here are the links we mentioned.</div>\r\n<div style=\"border-collapse: collapse; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: normal;\">SPARCS resources include workshops on: GameMaker, Android AppInventor, CSUnplugged, WebDesign, Lego Mindstorms, Logic/Circuitry, Security & Encryption.</div>\r\n<div style=\"border-collapse: collapse; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"></div>\r\n<div>\r\n<ul>\r\n<li style=\"border-collapse: collapse; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: normal;\">SPARCS resources + lesson plans & 5 years of feedback data: <a href=\"https://sites.google.com/a/ncsu.edu/sparcs-resources/\" target=\"_blank\" style=\"color: #1155cc;\">https://sites.google.com/a/ncsu.edu/sparcs-resources/<br /> </a></li>\r\n<li><span style=\"border-collapse: collapse; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: normal;\">UNC Charlotte SPARCS page (resources used in weekly format + monthly format): <a href=\"http://unccslc.starsalliance.org/sparcs\" target=\"_blank\" style=\"color: #1155cc;\">http://unccslc.starsalliance.org/sparcs<br /> </a></span></li>\r\n<li><span style=\"border-collapse: collapse; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: normal;\">NCSU SPARCS page (resources used in monthly format):Â <a href=\"http://research.csc.ncsu.edu/stars/sparcs\" target=\"_blank\" style=\"color: #1155cc;\">http://research.csc.ncsu.edu/stars/sparcs<br /> </a></span></li>\r\n<li><span style=\"border-collapse: collapse; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: normal;\">School pages were made using Drupal (free + out of the box ready to use):Â <a href=\"http://drupal.org/\" target=\"_blank\" style=\"color: #1155cc;\">http://drupal.org/</a></span></li>\r\n</ul>\r\n</div>\r\n</p>','groups.discussion','',69,42,0,0,0,'2012-08-17 13:01:53',0,'{\"action\":\"group.discussion.create\",\"topic_id\":69,\"topic\":\"SPARCS outreach materials\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=42\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=42&topicid=69\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(764,77,277,'Hi Nai,\n\nI wanted to give you a heads up that I have been in contact with Ebonie from Hickory Grove, and we are looking into ways we can do outreach through STARS with them.  Thanks for suggesting STARS to her, and I will keep you in the loop when we get something going so you can keep involved!\n\nRegards,\nScott','','profile','',77,NULL,NULL,0,0,'2011-09-29 20:46:20',20,'',1,1,'',255,255,764,'profile.status',764,'profile.status'),(766,104,104,'We\'ve posted a photo release form for you all to collect whenever you take pictures (at outreach events)- use if you want to publish the pictures or video that you take :)','','profile','',104,NULL,NULL,0,0,'2011-09-30 14:59:30',20,'',1,1,'',255,255,766,'profile.status',766,'profile.status'),(763,118,0,'{actor} started a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a> in <a href=_QQQ_{group_url}_QQQ_>New Members</a> group','<p>Hello all!Â  I just uploaded some files to the \"New Members\" folder found under \"Sharing -> Resources\".Â  Melinda and Sandy created these files and had a good turnout at the first STARS information session at SSC on Monday evening.Â  We thought we would post the PPT presentation, Flyer and Invitation Letter for anyone else that might want to take a look!Â  Hope all is well!</p>','groups.discussion','',18,NULL,NULL,0,0,'2011-09-29 20:13:07',20,'{\"action\":\"group.discussion.create\",\"topic_id\":18,\"topic\":\"Recruiting Resources\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=40\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=40&topicid=18\"}',1,1,'',255,255,0,'',0,''),(765,104,10