oupid=38&topicid=13\"}',1,1,'',255,255,0,'',0,''),(749,318,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>BPC SIG</a>','','groups','',43,NULL,NULL,0,0,'2011-09-26 14:20:20',20,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=43\"}',1,1,'',255,255,0,'',0,''),(750,318,318,'Sept 14-Oct 1 Auburn is performing Outreach Training for Alice & Lego Robotics: To see an outline of our outreach training materials goto  <a href=\"http://www.eng.auburn.edu/stars\">http://www.eng.auburn.edu/stars</a> and select Projects and then select Computer Club website. \n\nAuburn STARS work with after-school and in-school activities. Most of our groups are after-school and with one school as part of their formal After School Program. During the regular school day, we only have STARS connected with classes that are not directly tied to state standards. Our local schools have a Venture program as an exploratory class. This is an enrichment program directed toward providing all students a variety of educational opportunities including plays, speakers, interest development centers, mini courses, films, thinking skills development, exploratory classes, and self-directed learning and research.  It includes Auburn City Schools\' accelerated classes, advanced placement, and the International Baccalaureate Program at Auburn High School (description quoted from ACS website).','','profile','',318,NULL,NULL,0,0,'2011-09-26 22:21:59',20,'',1,1,'',255,255,750,'profile.status',750,'profile.status'),(741,315,315,'This is a social network?! Whoah. Crafty STARS.','','profile','',315,NULL,NULL,0,0,'2011-09-22 13:06:27',20,'',1,1,'',255,255,741,'profile.status',741,'profile.status'),(742,73,85,'Thanks for the invite but I will be in Portland, OR for the Grace Hopper Celebration getting fabulous ideas for our Celebration! Have fun!!','','events.wall','',85,0,85,1,0,'2011-09-23 13:21:29',20,'',1,1,'',255,255,742,'events.wa