 campus,  etc)<br /><br />Academic and Outreach: again with K-12 but can be otherwise;  Committee will work SOLELY on workshops and learning events (i.e.,  workshops on gaming, hack-a-thons, learning events like a computer crime  workshop for the community)<br /><br />Leadership and Professional  Development: solely for FAMU students;Â  committee will plan seminars on  various topics, as well as work with companies if necessary.<br /><br />Important Points:<br />- I would like each committee to have a chair and co-chair<br />- ALL members of STARS MUST belong to AT LEAST ONE committee<br /><br />Your Job:<br />-  You must email me your committee choices by Friday, Feb. 8; you must  also indicate if you wish to be a chair or co-chair of the committee at  that time</p>','groups.discussion','',100,6,0,0,0,'2013-02-05 21:10:21',0,'{\"action\":\"group.discussion.create\",\"topic_id\":100,\"topic\":\"Update on the STARS SCC Committees for 2013\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=6\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=6&topicid=100\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2436,139,0,'A Discussion has been started on STARS SCC Committees for the 2013 Year (Please Contribute ASAP)','','groups.wall','',6,6,0,0,0,'2013-02-05 21:09:55',0,'',1,1,'',255,255,2436,'groups.wall',2436,'groups.wall'),(2433,310,589,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-02-05 19:17:22',0,'',1,1,'',255,255,0,'',0,''),(2434,211,589,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-02-05 19:17:23',0,'',1,1,'',255,255,0,'',0,''),(2435,152,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>Academic Liaisons</a>','','groups','',66,0,0,1,0,'2013-02-05 19:56:13',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=66\"}',1,1,'',255,255,0,'',0,''),(682,139,0,'{actor} i