1,'',255,255,0,'',0,''),(2420,321,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p><span style=\"white-space: pre;\"> </span>As a team, the Robotics group has a major goal for Spring 2013 in that it wants to have a successful Middle School outreach trip. We plan to complete a maze game that children can participate in and solve problems using Teleop functionality with the robots and simple computing and logic skills they will learn throughout the game.</p>\r\n<p>Â </p>\r\n<p><span style=\"white-space: pre;\"> </span>By focusing on Middle school as an age range, this allows us time to focus on the hardware and teleop functionality of the Create-ASUS robots. As a team, we do not have the best grasp on the coding aspects of the shorthand language used for a robots. However, we are getting a definite hang of the hardware limitations of the robots.</p>\r\n<p>Â </p>\r\n<p><span style=\"white-space: pre;\"> </span>We definitely have room for more members this semester and will be meeting Thursdays at 4:00 p.m. in the Thurmond Linux Lab.</p>\r\n<p>Â </p>\r\n<p>-Jesse</p>','groups.discussion','',98,83,0,1,0,'2013-02-05 13:59:22',0,'{\"action\":\"group.discussion.create\",\"topic_id\":98,\"topic\":\"Goals for Spring 2013\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=83\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=83&topicid=98\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(823,77,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>ARTSI-STARS: Robotics Education and Outreach</a>','','groups','',56,NULL,NULL,0,0,'2011-10-04 20:31:54',20,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=56\"}',1,1,'',255,255,0,'',0,''),(824,77,0,'{actor} added {multiple}{count} new photos{/multiple}{single}a new photo{/single} in the group album <a href=_QQQ_{photo_url}_QQQ_>Tekkotsu workshop at UNCC</