,(1101,163,0,'{actor} added a new group event <a href=_QQQ_{event_url}_QQQ_>Join AAWCS and STARS Alliance for CNN TV Special Viewing, \"Black in America, Silicon Valley\"</a>','','events','',114,NULL,NULL,0,0,'2011-11-11 23:52:23',20,'{\"action\":\"events.create\",\"event_url\":\"index.php?option=com_community&view=events&task=viewevent&eventid=114&groupid=6\",\"event_category_url\":\"index.php?option=com_community&view=events&categoryid=5&groupid=6\"}',1,1,'Cropper Hall Common Area at FAMU',255,255,114,'events',114,'events'),(1102,163,0,'{actor} started a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a> in <a href=_QQQ_{group_url}_QQQ_>Florida Agricultural and Mechanical University</a> group','<div class=\"clabel\">Event: Join AAWCS and the STARS Alliance forÂ the viewing ofÂ CNN TV Special \" Black in America, Silicon Valley\"</div>\r\n<div class=\"clabel\">Location:</div>\r\n<div id=\"community-event-data-location\" class=\"cdata\">Cropper Hall Common Area at FAMU</div>\r\n<div class=\"cparam event-created\">\r\n<div class=\"cdata small\"><span>Time </span>Sunday, 13 November 2011 07:45 PM</div>\r\n</div>\r\n\r\n<div class=\"cparam event-tickets\">\r\n<div class=\"clabel\">Event Details</div>\r\n</div>\r\n<div class=\"event-desc\">\r\n<p><em><strong>****AAWCS and STARS Members, please come out and support the cause. This will be advertised to students in Gibbs and Cropper Hall as well as friends of friends. This will also count as activity points!! Due to limited funding, I am encouraging everyone to bring  a snack. If you are able to attend or would like to assist with this event, please email me at </strong><a href=\"mailto:jessicaherd@hotmail.com\"><strong><span style=\"text-decoration: underline;\"><span style=\"color: #cc0033;\">jessicaherd@hotmail.com</span></span></strong></a><strong>. ****</strong></em></p>\r\n<p>Join African American Women in Computer Science and the STARS Alliance as we watch CNN\'s TV Special, \"Black in America Silicon Valley\"</p>\r\n<p>Purpose: Our goal is to increase the awareness of STEM majors and business options in technology.</p>\r\n<p>Background: Silicon Valley is the leader of innovation and development. Silicon Valley is home to many technological corporations like Google, Yahoo, Skype, BAE Systems, Adobe Systems, Cisco, Facebook and much more. However, currently less than one percent of all venture capital money went to digital start ups with African-American founders in 2010. This documentary will follow eight strangers as they help other entepreneurs secure funding to establish technology focused businesses despite racism, statistics and criticism.</p>\r\n<p>If you have questions contact Angel Bobo at               209-496-5292        209-496-5292 or Jessica Herd at               850-274-5649        850-274-5649 or by email <a href=\"mailto:jessicaherd@hotmail.com\"><span style=\"text-decoration: underline;\"><span style=\"color: #cc0033;\">jessicaherd@hotmail.com</span></span></a></p>\r\n</div>','groups.discussion','',32,NULL,NULL,0,0,'2011-11-11 23:57:36',20,'{\"action\":\"group.discussion.create\",\"topic_id\":32,\"topic\":\"A chance to earn STARS Activity Points!!\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=6\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=6&topicid=32\"}',1,1,'',255,255,0,'',0,''),(1103,439,427,'{actor} and {target} are now connected','','friends','',0,NULL,NULL,0,0,'2011-11-12 02:36:47',20,'',1,1,'',255,255,0,'',0,''),(1104,283,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>Graduate Research</a>','','groups','',39,NULL,NULL,0,0,'2011-11-14 03:24:41',20,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=39\"}',1,1,'',255,255,0,'',0,''),(1105,283,39,'Hey guys.. I just joined the group and was wondering if any of you guys were doing research in the area of vision? or even use vision in