nds','',0,0,0,1,0,'2013-10-30 00:54:43',0,'',1,0,'',255,255,0,'',0,''),(3040,104,104,'Be on the look out for surveys from Friends of STARS. The Computing Research Association will be inviting students and faculty to participate in their national survey in November. You all are their target audience, so please volunteer. (Just to be clear- STARS is not conducting this survey, but CRA is a collegial alliance)','','profile','',104,0,0,1,0,'2013-10-30 14:32:03',20,'',1,0,'',255,255,3040,'profile.status',3040,'profile.status'),(1133,452,0,'{actor} uploaded a new avatar','','profile','',0,NULL,NULL,0,0,'2011-11-17 15:02:02',20,'',1,1,'',255,255,452,'profile.avatar.upload',452,'profile.avatar.upload'),(1134,452,0,'{actor} uploaded a new avatar','','profile','',0,NULL,NULL,0,0,'2011-11-17 15:15:11',20,'',1,1,'',255,255,452,'profile.avatar.upload',452,'profile.avatar.upload'),(1135,422,407,'{actor} and {target} are now connected','','friends','',0,NULL,NULL,0,0,'2011-11-17 19:15:08',20,'',1,1,'',255,255,0,'',0,''),(1136,77,312,'{actor} and {target} are now connected','','friends','',0,NULL,NULL,0,0,'2011-11-17 20:56:14',20,'',1,1,'',255,255,0,'',0,''),(1137,395,0,'{actor} created a new group, <a href=_QQQ_{group_url}_QQQ_>Summer Camps</a> in <a href=_QQQ_{category_url}_QQQ_>Affinity Groups</a>','<p>This group is for discussing all things summer camp! Â If you are a school that has run a robotics or other type of summer camp before, please share your experiences and best practices. Â If you are a school interested in starting a summer camp, post your questions here!</p>','groups','',57,NULL,NULL,0,0,'2011-11-17 21:06:20',20,'{\"action\":\"group.create\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=57\",\"category_url\":\"index.php?option=com_community&view=groups&categoryid=17\"}',1,1,'',255,255,0,'',0,''),(1138,77,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>Summer Camps</a>','','