iki.squeakland.org/display/sq/Home\n\neToys projects made at Illinois\neToysIllinois.org\n\neToys projects in many languages\ntranslate.sugarlabs.org/projects/etoys_new/ ','','events.wall','',47,0,47,1,0,'2012-02-05 15:21:05',20,'',1,1,'',255,255,1395,'events.wall',1395,'events.wall'),(1565,439,0,'{actor} uploaded a new avatar','','profile','',0,0,0,1,0,'2012-07-06 18:30:50',0,'',1,1,'',255,255,439,'profile.avatar.upload',439,'profile.avatar.upload'),(1566,42,0,'{actor} created a new group, <a href=_QQQ_{group_url}_QQQ_>STARS HOME</a> in <a href=_QQQ_{category_url}_QQQ_>Affinity Groups</a>','<p>Stars Home Group</p>','groups','',65,65,0,0,0,'2012-07-09 19:20:35',0,'{\"action\":\"group.create\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"category_url\":\"index.php?option=com_community&view=groups&task=display&categoryid=17\"}',1,1,'',255,255,1566,'groups.create',1566,''),(1396,122,0,'{actor} replied a discussion <a href=_QQQ_{discuss_url}_QQQ_>Haitian Creole App and other Language Learning Tools</a> in <a href=_QQQ_{group_url}_QQQ_>{group_name}</a> group','A book too:\nCreole made easy  \n  http://www.amazon.com/Creole-Made-Easy-Wally-Turnbull/dp/0967993717/ref=sr_1_1?s=books&ie=UTF8&qid=1328455448&sr=1-1','groups','',47,NULL,NULL,0,0,'2012-02-05 15:24:44',20,'{\"action\":\"group.discussion.reply\",\"wallid\":105,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=47\",\"group_name\":\"STARS Haiti\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=47&topicid=15\"}',1,1,'',255,255,0,'',0,''),(1397,203,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>STARS Haiti</a>','','groups','',47,NULL,NULL,0,0,'2012-02-05 15:51:25',20,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=47\"}',1,1,'',255,255,0,'',0,''),(1398,509,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>STARS Haiti</a>','','groups','',47,NULL,NULL,0,0,'2012-02-05 19:45:28',20,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=47\"}',1,1,'',255,255,0,'',0,''),(1399,167,131,'A few things:\n1. The song for the Nicaragua video is actually a modern song by a group called Celtic Women (translated to Spanish). The song is beautiful (if you like Celtic music...), and this has the lyrics:\nhttp://www.youtube.com/watch?v=ZgDqrziAryw\n\n2. Tracy Kidder, who wrote Mountains Beyond Mountains, is an amazing author who wrote another book, called Soul of a New Machine, which is one of the most awesome books about computers ever. I\'m planning on reading this book next.\n\n3. Haiti After the Earthquake is an amazing book, but it\'s long and heavy. I would love everyone to read this book, but it\'s not the first book you should read about Haiti.','','events.wall','',131,0,131,1,0,'2012-02-05 19:46:47',20,'',1,1,'',255,255,1399,'events.wall',1399,'events.wall'),(1628,363,363,'Currently in Managing Teams and Project','','profile','',363,0,0,1,0,'2012-08-12 15:36:44',20,'',1,1,'',255,255,1628,'profile.status',1628,'profile.status'),(1690,45,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>Please upload your presentation from the Celebration here. Please make sure to include the last name of the presenter in the title of the presentation.</p>','groups.discussion','',71,65,0,0,0,'2012-08-20 18:14:22',0,'{\"action\":\"group.discussion.create\",\"topic_id\":71,\"topic\":\"Presentations for Celebration 2012\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=71\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(1401,273,0,'{actor} is attending <a href=_QQQ_{event_url}_QQQ_>STARS Haiti and eToys workshop</a>.','','events','',131,NULL,NULL,0,0,'2012-02-05 2