in: 0in 0in 0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><span style=\"color: #000000;\"><span style=\"text-decoration: underline;\"><span style=\"font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">This group is the research pod for Evaluation Assistants who are conducting formative evaluation projects.</span></span><span style=\"font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">The formative project is a âhow toâ project is to monitor and track an aspect of your SLC, and to present lessons learned and procedural how toâs (step-by-step, checklists, samples, models, etc.). This is calledÂ formative evaluation. All projects will be presented in poster format at the end of the term, and submitted to the STARS Celebration. Other professional conference submissions will be encouraged.</span></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><span style=\"color: #000000;\"><span style=\"font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">Â </span></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><span style=\"color: #000000;\"><span style=\"font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">This group, or pod, is for sharing ideas, questions, and resources.Â  For example, inÂ March,Â EAs will post an abstract of one article that they found relevant to their project.</span></span></span></p>','groups','',60,NULL,NULL,0,0,'2012-03-13 15:30:33',20,'{\"action\":\"group.create\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=60\",\"category_url\":\"index.php?option=com_community&view=groups&task=display&categoryid=17\"}',1,1,'',255,255,0,'',0,''),(1497,104,0,'{actor} uploaded a new avatar for the group, <a href=_QQQ_{group_url}_QQQ_>EA Research Pod- Formative Project Group</a>','<img src=\"http://community.starsalliance.org/images/avatar/groups/thumb_061b9d2fa72a4236cb203e11.jpg\" style=\"border: 1px solid #eee;margin-right: 3px;\" />','groups','',60,NULL,NULL,0,0,'2012-03-13 15:31:35',20,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=60\"}',1,1,'',255,255,0,'',0,''),(1498,104,0,'{actor} created a new group, <a href=_QQQ_{group_url}_QQQ_>EA Research Pod- Research Group</a> in <a href=_QQQ_{category_url}_QQQ_>Affinity Groups</a>','<p class=\"MsoNormal\" style=\"margin: 0in 0in 0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><span style=\"color: #000000;\"><span style=\"text-decoration: underline;\"><span style=\"font-family: \'Calibri\',\'sans-serif\';\">This group is the research pod for Evaluation Assistants who are conductingÂ research evaluation projects.</span></span><span style=\"font-family: \'Calibri\',\'sans-serif\';\">The <span style=\"font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; font-size: 10pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Research projects set a goal(s) of what the SLC will accomplish, determine a method to measure the goal(s), measure/assess the goal(s), and write a poster to showcase SLC outcomes. This is evaluation research.<span style=\"mso-spacerun: yes;\">Â </span></span> All projects will be presented in poster format at the end of the term, and submitted to the STARS Celebration. Other professional conference submissions will be encouraged.</span></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><span style=\"color: #000000;\"></span></span>Â </p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><span style=\"color: #000000;\"><span style=\"font-family: \'Calibri\',\'sans-serif\';\">This