and {target} are now friends','','friends','',0,0,0,1,0,'2012-09-05 17:55:50',0,'',1,1,'',255,255,0,'',0,''),(2833,395,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p class=\"MsoPlainText\">We hope that you enjoyed the workshop at the STARS Celebration on preparing for the 2014 ARTSI Robotics Competition, which will be held at the Tapia Celebration of Diversity in Computing in February 2014. If you are thinking of participating in the robotics competition, we encourage you to apply for a Tapia travel scholarship! Travel scholarships are available for both faculty and students. The application process for Tapia travel scholarships is separate from registering for the ARTSI Robotics Competition. To apply for a Tapia travel scholarship, submit your application at <a href=\"http://tapiaconference.org/participate/scholarships\">http://tapiaconference.org/participate/scholarships</a>. Make sure to mention that you are planning to participate in the ARTSI Robotics Competition in your application. The deadline for Tapia travel scholarship applications is September 12, 2013.</p>\r\n<p class=\"MsoPlainText\"><span style=\"line-height: 1.3em;\">For more information about the ARTSI Robotics Competition, see </span><a href=\"http://www.cs.cmu.edu/~dst/ARTSI/Robotics14/\" style=\"line-height: 1.3em;\">http://www.cs.cmu.edu/~dst/ARTSI/Robotics14/</a><span style=\"line-height: 1.3em;\">. </span></p>','groups.discussion','',152,66,0,0,0,'2013-09-03 17:47:34',0,'{\"action\":\"group.discussion.create\",\"topic_id\":152,\"topic\":\"ARTSI Robotics Competition\\/Tapia\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=66\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=66&topicid=152\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2803,481,980,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-08-24 15:19:40',0,'',1,1,'',255,255,0,'',0,''),(2804,653,204,'{actor} and {t