wall',1910,'groups.wall'),(1911,313,0,'October 9, 2012 Marshall Elementary section 1 \nShilindria Rivers, Eric Collins and Kendall Brice went to Marshall Elementary, to work with the 3rd graders using Microsoft Excel. The SLC students showed them how to use Excel, to create charts and graphs using there favorite sports.','','groups.wall','',21,21,0,0,0,'2012-10-16 14:26:37',0,'',1,1,'',255,255,1911,'groups.wall',1911,'groups.wall'),(1912,313,0,'On October 9, 2012 Tre\' Addison, Luis Figueroa, Rakim Harvin, and Joh-nette Brown went to Felton Elementary, to work with the 3rd, 4th, 5th and 6th graders to build the Lego Mindstorm NXT robots. Each group had a simple program they had to perform on there NXT robots. The 3rd graders was still building there Lego Mindstorm NXT robots, because they started later then the other grade levels.','','groups.wall','',21,21,0,0,0,'2012-10-16 14:28:32',0,'',1,1,'',255,255,1912,'groups.wall',1912,'groups.wall'),(1913,313,0,'October 11, 2012 Marshall Elementary section 1 \nShilindria Rivers, Eric Collins and Kendall Brice went to Marshall Elementary, to work with the 5th graders using Microsoft Excel. The SLC students showed them how to use Excel, to create a grade book and also showed the students how to use the table look up function in Excel.','','groups.wall','',21,21,0,0,0,'2012-10-16 15:02:05',0,'',1,1,'',255,255,1913,'groups.wall',1913,'groups.wall'),(2800,1161,1157,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-08-23 05:10:57',0,'',1,1,'',255,255,0,'',0,''),(2801,1157,1156,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-08-23 12:11:33',0,'',1,1,'',255,255,0,'',0,''),(1915,797,104,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2012-10-17 17:03:04',0,'',1,1,'',255,255,0,'',0,''),(1916,45,0,'Thinking about grad school or know someone who is? UNC Charlotte is hosting students across the region to come learn about graduate school and the opportunities at UNC Charlotte