ted program, and will attend the Stars conference in August 2013 as a NWFSC stars member. If you have any questions, contact Heidi Gentry-Kolen at gentryh@nwfsc.edu. Also, Stars has an open enrollment. So, if you know anyone that would like to be a part of this group, they can do so by talking to our project manager and registering on the Stars alliance website  <a href=\"http://community.starsalliance.org/\">http://community.starsalliance.org/</a>. Unfortunately, we did not have a photographer and were unable to take a group photo during this meeting. We will be having one more meeting this semester in a couple weeks. As we did with this meeting, we will use a doodle survey to figure out the best time.\n	Our main topic of discussion during this meeting was determining our current project. After brainstorming ideas and voting. We have decided to mix robotics with gaming and create a mechanical Galaga game with robots operated by a Galaga game on a computer. More details will be released soon.','','groups.wall','',20,20,0,0,0,'2012-11-16 20:42:43',0,'',1,1,'',255,255,2120,'groups.wall',2120,'groups.wall'),(2121,862,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>Ideas/Comments on our current project.</p>','groups.discussion','',87,20,0,0,0,'2012-11-16 20:44:35',0,'{\"action\":\"group.discussion.create\",\"topic_id\":87,\"topic\":\"Galaga Project\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=20\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=20&topicid=87\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2903,544,0,'{multiple}{actors}{/multiple}{single}{actor}{/single} joined the group <a href=_QQQ_{group_url}_QQQ_>NC 7 EA Group</a>','','groups','',94,0,0,1,0,'2013-09-17 19:25:47',0,'{\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=94\"}',1,1,'',255,255,0,'',0,''),(2904,544,0,'Hey NC 7!','','groups.wall','',94,94,0,0,0,'2013-09-17 