ela Gonzales. I go by \"Ang\" (pronounced as the first  syllable to \'Angela\'). I am in the BS-IT Program and was encouraged to  join (in a *very* enthusiastic manner) this group so I hope that I will  be a help to this group and get to know everyone here.</p>\r\n<p>Typically I  take on-campus courses since I find that\'s the best way that I learn  but the way things have turned out for this term, everything\'s going to  be online. So this means that I <span style=\"text-decoration: underline;\">need</span> to stay up to date with events so that I know when to plan a <em>visit</em> to campus (I live in the UCF area and it\'s almost a 40 min. commute to the SLM campus).</p>\r\n<p>At  home, I provide medical assistance for two family members so I must  manage my time wisely. (most of the homework I do is while waiting in a  Dr.\'s waiting room) For hobbies, I enjoy games (video, tabletop),  LOLcats, drawing, programming, and poking at electronics with a stick  (i.e. experiment with stuff) which is how to create/run a minecraft  server right at the moment.</p>\r\n<p>Anyway, I hope that this brief \'hello\'  should be enough to start with and I hope that it doesn\'t get eaten  again. (Um, would that count as a valid excuse for why someone\'s  homework is turned in late?)</p>\r\n<p>P.S. This thing went \"Derp\" again - session timed out. (yay for notepad!)</p>','groups.discussion','',89,28,0,0,0,'2013-01-10 22:02:01',0,'{\"action\":\"group.discussion.create\",\"topic_id\":89,\"topic\":\"Hello new person here\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=28\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=28&topicid=89\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2190,77,0,'{actor} is attending <a href=_QQQ_{event_url}_QQQ_>Science Fair Judging</a>.','','events','',242,0,242,1,0,'2013-01-11 18:26:06',0,'{\"eventid\":\"242\",\"action\":\"events.attendence.attend\",\"event_url\":\"\\/index.ph