n our host that we were not made aware of was sometimes being exceeded. We have moved email hosts, which has resolved most problems and we are now hunting down some remaining bugs in how this software sends email and will hopefully have this all fixed by Monday.</p>\r\n<p>So, if a student says they didn\'t receive an email about a discussion or event you posted recently, they may be correct. Everything is correct once you log in, its just the emails that were impacted. If you spot any more issues or have any questions, add to this discussion and let me know! I apologize for any inconvenience.</p>','groups.discussion','',104,66,0,0,0,'2013-02-22 21:35:37',0,'{\"action\":\"group.discussion.create\",\"topic_id\":104,\"topic\":\"Email issue for the online community\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=66\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=66&topicid=104\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2476,77,0,'{actor} added a new group event <a href=_QQQ_{event_url}_QQQ_>CIAA NASA Day </a>','','events','',295,3,295,0,0,'2013-02-15 02:02:06',0,'{\"action\":\"events.create\",\"event_url\":\"index.php?option=com_community&view=events&task=viewevent&eventid=295&groupid=3\",\"event_category_url\":\"index.php?option=com_community&view=events&task=display&categoryid=5&groupid=3\"}',1,1,'Charlotte Convention Center',255,255,295,'events',295,'events'),(2477,500,500,'Today STARS at CPCC will be reaching out to our local seniors. We have partnered with Digital Gap Charlotte to host a cellphone/smartphone workshop. Our students will be assisting seniors from the Anita Shroud Senior Complex. This is the first in a series of technology workshops especially designed to help close the digital gap that exists for our elderly and underrepresented.','','profile','',500,0,0,1,0,'2013-02-15 14:12:49',20,'',1,1,'',255,255,2477,'profile.status',2477,'profile.status'),(2478,310,211,'{actor} a