ad',853,'profile.avatar.upload'),(2650,748,0,'{actor} uploaded a new avatar','','profile','',0,0,0,1,0,'2013-04-15 14:37:24',0,'',1,1,'',255,255,748,'profile.avatar.upload',748,'profile.avatar.upload'),(2651,696,0,'Replied to the <a href=_QQQ_{discuss_url}_QQQ_>CS UNPLUGGED</a>','Sorry, I can\'t provide much.\nOur STARS group just had to switch faculty reps and he\'s in the process of learning the ropes this semester.\nHe and the rest of the group have tried reaching out to many K-12 schools, mostly high schools, and haven\'t really gotten positive responses (if any) back. However it does look like we have a 6th-12th grade school interested in setting something up for Fall 2013. I think the initial plan is to use Scratch or BYOB and see how the kids respond.\n\nGood luck Chaya!','groups.discussion.reply','',119,65,0,0,0,'2013-04-15 15:51:30',0,'{\"action\":\"group.discussion.reply\",\"wallid\":240,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"group_name\":\"STARS HOME\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=119\"}',1,1,'',255,255,0,'',240,'groups.discussion.reply'),(2652,73,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>The submission deadline for STARS Celebration 2013 has been extended to <strong>Friday, April 19</strong>. We received several emails indicating access the submission site was unavailable. Please note the instructions below for submitting your proposal.</p>\r\n<p>Posters, panels, presentations, lighting talks and BOF are still needed for this year\'s conference. Be sure and submit your best practices and activities to share with your peers.</p>\r\n<p>If you are still experiencing difficulty, please contact <strong>Ashley Peeler @ ashley.peeler@uncc.edu</strong> or <strong>Scott Heggen @ sheggen@uncc.edu</strong></p>\r\n<p>1. Visit <a href=\"http://www.starscelebration.org\" target=\"_blank\">www.starscelebration.org</a></p>\r\n<p>2. Click on the menu tab that reads \"<a href=\"http://starscelebration.org/stars-celebration-cfp\" target=\"_blank\">Call for Participation</a>\" - here you will find all relevant submission topic information</p>\r\n<p>3. Click on the menu tab that reads \"<a href=\"http://starscelebration.org/stars-celebration-submission-instructions\" target=\"_blank\">Submission Instructions</a>\" - here you will find the requirements and instructions on creating an EasyChair account and how to submit.</p>\r\n<p>4. If this does not work, you can follow this link to sign in or create an account. <a href=\"https://www.easychair.org/account/signin.cgi?conf=starscelebration2013\" target=\"_blank\">https://www.easychair.org/account/signin.cgi?conf=starscelebration2013</a></p>\r\n<p>Thank you from your 2013 Celebration Program Committee</p>','groups.discussion','',126,65,0,0,0,'2013-04-15 16:53:47',0,'{\"action\":\"group.discussion.create\",\"topic_id\":126,\"topic\":\"STARS Celebration 2013 - Call For Participation Deadline Extended to April 19\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=126\"}',1,1,'',255,255,0,'',-1,'groups.discussion'),(2653,313,0,'Where do I submit the spring narrative report at?','','groups.wall','',65,65,0,0,0,'2013-04-16 02:17:14',0,'',1,1,'',255,255,2653,'groups.wall',2653,'groups.wall'),(2654,1079,313,'There is a Drop Box folder that you need to summit it to but only Dr. Rorrer can make it available to you. Hour previous EA had to turn it in for us. Or just email Dr. Rorrer and explain it to her... perhaps also attach the file.','','profile','',1079,0,0,1,0,'2013-04-16 03:02:22',20,'',1,1,'',255,255,2654,'profile.status',2654,'profile.status'),(2655,104,313,'Julius- I had given you access with ellisontyree@yahoo.com....and have now also added your jellison@scsu.edu email to the drop box folder, so you should be able to view/upload now :)','','profile','',104,0,0,1,0,'2013-04-16 18:48:03',20,'',1,1,'',255,255,2655,'profile.status',2655,'profile.status'),(2656,104,104,'A great question about the narratives.....with my response: \nNo, do not include fall semester on the spring report, UNLESS the activity didn\'t get reported in fall. We want to count all activities, but not double count, so if you\'ve reported an activity last fall, don\'t repeat it.\n\nIf you have more activities coming up this semester, after April 30 (the absolute deadline for narratives:), then you have 2 options:\n1. report the activity and guestimate the numbers (and don\'t report again next fall) or\n2. save the activity for the fall report\n\nI actually prefer that you choose #1 if you are fairly certain of your participation (for example, its a repeat event and you know you\'ll have 10 girl scouts). But if it\'s a one time event and you don\'t have any idea how many people will show up, I prefer you save it for next fall. \n\nActivity Reports can be filed at anytime, all year long, so you can \'log it\' and not forget about it next term.','','profile','',104,0,0,1,0,'2013-04-16 19:10:22',20,'',1,1,'',255,255,2656,'profile.status',2656,'profile.status'),(2657,942,0,'Now that the narrative is submitted...........   I missed last weeks cohort meeting not once but twice.  Can anyone fill me in on the just of the meeting?','','groups.wall','',65,65,0,0,0,'2013-04-16 20:50:40',0,'',1,1,'',255,255,2657,'groups.wall',2657,'groups.wall'),(2658,653,227,'{actor} and {target} are now friends','','friends','',0,0,0,1,0,'2013-04-16 21:03:45',0,'',1,1,'',255,255,0,'',0,''),(2659,77,0,'{actor} added a new group event <a href=_QQQ_{event_url}_QQQ_>Carolina Code Camp 2013</a>','','events','',336,65,336,0,0,'2013-04-17 15:01:10',0,'{\"action\":\"events.create\",\"event_url\":\"index.php?option=com_community&view=events&task=viewevent&eventid=336&groupid=65\",\"event_category_url\":\"index.php?option=com_community&view=events&task=display&categoryid=6&groupid=65\"}',1,1,'CPCC Levine Campus 2800 Campus Ridge Road Matthews, NC 28105',255,255,336,'events',336,'events'),(2660,129,0,'Replied to the <a href=_QQQ_{discuss_url}_QQQ_>CS UNPLUGGED</a>','We have also used many of the CS Unplugged activities.  Error detection/Card Flip Magic is always good.  We do that with a deck of cards.  Make sure that you have the kids do it as well.  We also do Minimal Spanning Trees / The Muddy City.  It is a worksheet, but they have to think and you can relate it to networks.  We do Routing and Deadlock / The Orange Game with colored popsicle sticks instead of fruit.  The Finite State Automata / Treasure Hunt is fun, but you need space to do this.  We have also used Binary Numbers and Image Representation.  ','groups.discussion.reply','',119,65,0,0,0,'2013-04-17 19:25:31',0,'{\"action\":\"group.discussion.reply\",\"wallid\":243,\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"group_name\":\"STARS HOME\",\"discuss_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid=65&topicid=119\"}',1,1,'',255,255,0,'',243,'groups.discussion.reply'),(2661,73,0,'Posted a new discussion, <a href=_QQQ_{topic_url}_QQQ_>{topic}</a>','<p>Last call for proposal submissions for Celebration is tonight. Be sure and submit your ideas! All are welcome and encouraged!! If you have trouble contact Ashley at ashley.peeler@uncc.edu or Scott at sheggen@uncc.edu</p>\r\n<p>Â </p>\r\n<p>Visit <a href=\"http://www.starscelebration.org\" target=\"_blank\">www.starscelebration.org</a> for more information!</p>\r\n<p>Happy proposing!</p>','groups.discussion','',127,65,0,0,0,'2013-04-19 20:51:52',0,'{\"action\":\"group.discussion.create\",\"topic_id\":127,\"topic\":\"CFP Deadline Reminder = TONIGHT!\",\"group_url\":\"index.php?option=com_community&view=groups&task=viewgroup&groupid=65\",\"topic_url\":\"index.php?option=com_community&view=groups&task=viewdiscussion&groupid